summary = "Python HTTP for Humans."
dependencies = [
    "certifi>=2017.4.17",
    "charset-normalizer~=2.0.0; python_version >= \"3\"",
    "idna<4,>=2.5; python_version >= \"3\"",
    "urllib3<1.27,>=1.21.1",
]

[[package]]
name = "typing-extensions"
version = "3.10.0.2"
summary = "Backported and Experimental Type Hints for Python 3.5+"

[[package]]
name = "urllib3"
